import VideoAbcdarioDemo from '../views/VideosAbcdarioDemo.vue'
import VideoColoresDemo from '../views/VideoColoresDemo.vue'
import VideoPronombresDemo from '../views/VideoPronombresDemo.vue'
import Traductor from '../views/Traductor.vue'

Vue.use(VueRouter)

const routes = [
    {
        path: '/',
        name: 'Home',
        component: Home,
        meta: { authorize: [Role.user, Role.admin, Role.libre] }
    },
    {
        path: '/manager',
        name: 'ReConsultaManager',
        component: ReConsultaManager,
        meta: { authorize: [Role.user, Role.admin] }
    },
    {
        path: '/primerconsulta',
        name: 'Consulta',
        component: Consulta,
        meta: { authorize: [Role.user, Role.admin] }
    },
    {
        path: '/nuevaconsulta',
        name: 'NuevaConsulta',
        component: NuevaConsulta,
        meta: { authorize: [Role.user, Role.admin] }
    },
    {
        path: '/datos-consultas',
        name: 'DatosConsultas',
        component: DatosConsultas,
        meta: { authorize: [Role.user, Role.admin] }
    },
    {
        path: '/datos-pacientes',
        name: 'DatosPacientes',
        component: DatosPacientes,
        meta: { authorize: [Role.user, Role.admin] }
    },
    {
        path: '/dashboard',
        name: 'Dashboard',
        component: Dashboard,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/cheque',
        name: 'Cheque',
        component: Cheque,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/editarcheque',
        name: 'EditarCheque',
        component: EditarCheque,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/compra',
        name: 'Compra',
        component: Compra,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/editarcompra',
        name: 'EditarCompra',
        component: EditarCompra,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/login',
        name: 'Login',
        component: Login
    },
    {
        path: '/librobanco',
        name: 'LibroBanco',
        component: LibroBanco,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/user',
        name: 'User',
        component: User,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/report',
        name: 'Reporte',
        component: Report,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/reportype',
        name: 'Reporte Especifico',
        component: ReportType,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/newoldreconsultation',
        name: 'Registro Viejos Expedientes',
        component: OldConsulta,
        meta: { authorize: [Role.user, Role.admin] }
    },
    {
        path: '/editoldconsultation',
        name: 'Editar Viejos Expedientes',
        component: EditOldConsulta,
        meta: { authorize: [Role.user, Role.admin] }
    },
    {
        path: '/reporteexpedientesviejos',
        name: 'Reporte Expedientes Viejos',
        component: ReportePacientesOld,
        meta: { authorize: [Role.user, Role.admin] }
    },
    {
        path: '/deleteFact',
        name: 'Elimina Factura',
        component: DeleteFactura,
        meta: { authorize: [Role.admin] }
    },
    {
        path: '/cargamasivaExcel',
