        name: 'InfoColores',
        component: InfoColores
    },
    {
        path: '/infonumeros',
        name: 'InfoNumeros',
        component: InfoNumeros
    },
    {
        path: '/infopronombres',
        name: 'InfoPronombres',
        component: InfoPronombres
    },
    {
        path: '/infovideo',
        name: 'InfoVideo',
        component: InfoVideo,
        meta: { authorize: [Role.user, Role.admin] }
    },
    {
        path: '/videoabcdario',
        name: 'VideoAbcdario',
        component: VideoAbcdario
    },
    {
